import React from 'react';
import ComingSoon from '../components/ComingSoon';

const ThreatsIOCs = () => {
  return (
    <ComingSoon
      title="Indicators of Compromise (IOCs)"
      description="Advanced IOC management and analysis capabilities are currently under development. This platform will provide comprehensive threat indicator tracking and analysis."
      icon="🔍"
      expectedDate="Q2 2025"
      features={[
        "IOC collection and management",
        "Threat intelligence integration",
        "Automated IOC detection",
        "IOC correlation analysis",
        "Sharing and collaboration",
        "Compliance reporting"
      ]}
    />
  );
};

export default ThreatsIOCs;
